import contentImageTwo from "./images/p1.png";
import contentImageOne from "./images/p1.png";
import content from './contents.json';
export const tLogo=content.logo;
export const hasScroll=content.hasScroll
export const RouteItems = content.routeItemsDefault.concat(content.routeItems);
export const routeItems=content.routeItems;
export const imageURLArray = content.imageURLArray;

export const mainButtonTitle=content.mainButtonTitle||'Apply Now';
export const mainButtonLink =content.mainButtonLink;
export const contactButtonTitle='Contact Us';

export const titleContent=content.titleContent;
export const titleBlurb=content.titleBlurb;
export const supportingHeading =content.supportingHeading;
export const supportingHeading2 =content.supportingHeading2;
export const supportingBlurb =content.supportingBlurb;
export const secondaryContentTitle=content.secondaryContentTitle;
export const secondaryContent =content.secondaryContent

//other


export const businessBlurb = content.businessBlurb
export const contactTitle=content.contactTitle;
export const contactEmail = content.contactEmail;
export const contactPhone = content.contactPhone;
export const contactBlurb = content.contactBlurb;


//secondary

export const secondaryHeader=content.secondaryHeader;
export const secondaryHeading1=content.secondaryHeading1;
export const secondaryContent1=content.secondaryContent1;
export const secondaryHeading2=content.secondaryHeading2;
export const secondaryContent2=content.secondaryContent2;
export const businessBlurbShort=content.businessBlurbShort;
export const secondaryPhoto1=contentImageOne;
export const secondaryPhoto2=null;
export const contactCTA='Make an enquiry';
//third

export const p3Header=content.p3Header;
export const p3Heading1=content.p3Heading1;
export const p3Content1=content.p3Content1;
export const p3Heading2=content.p3Heading2;
export const p3Content2=content.p3Content2;
export const p3ContentPhoto=contentImageTwo;
export const backgroundType=content.backgroundType;
export const bgClass = content.class;
